import React from 'react';
import burgerLogo from '../../assets/images/burger-logo.png';
import classes from './Logo.module.css';

const Logo = ({height}) => {
    return (
        <div className={classes.Logo} style={{height: height}}>
            <img src={burgerLogo} alt='burger-logo' />
        </div>
    );
};

export default Logo;
